package com.study.phoebus.response;import java.io.Serializable;public class BaseResponse implements Serializable {    private Object data;    private String code;    private String msg;    public Object getData() {        return data;    }    public void setData(Object data) {        this.data = data;    }    public String getCode() {        return code;    }    public void setCode(String code) {        this.code = code;    }    public String getMsg() {        return msg;    }    public void setMsg(String msg) {        this.msg = msg;    }}